pragma solidity 0.7.6;

import "../l2/dai.sol";

/// @dev A contract that will receive Dai, and allows for it to be retrieved.
contract Alice {
    constructor (address dai, address usr) public {
        Dai(dai).approve(usr, type(uint256).max);
    }
